class CHOOSE_MATERIAL():
    step_name = 'CHOOSE_MATERIAL'

    def __init__(self):
        print(f'Registering {self.step_name} step')

    def predict(self,img,material1,material2):
        prompt1 = f'Tell me what the objects look like when it is made of {material1} in one sentence.'
        prompt2 = f'Tell me what the objects look like when it is made of {material2} in one sentence.'
        material_desc1 = API.gpt3(prompt1, 'gpt3_general')
        material_desc2 = API.gpt3(prompt2, 'gpt3_general')
        result1 = API.clip(img,material_desc1)
        result2 = API.clip(img,material_desc2)
        if result1 > result2:
            result = material1
        else:
            result = material2
        return result

    def execute(self,img,material1,material2):
        result = self.predict(img,material1,material2)
        return result
